ty of 109 M-1. 50% of I125 IGFI are bound at a final dilution\r\nof the ascites of 1:20\'000. The antibody crossreact 3% with IGF II but not with insulin and\r\ncan be used for immunopurification of IGF\'s from human serum. It recognize IGF I of other\r\nspecies with following approximate relative potencies: guinea pig, rabbit, human, rat and\r\nmouse =7:4:1:&lt;0.01:&lt;0.01</div>'),(290,76,0,157,'with 200 μl bidistilled water'),(291,85,0,157,'Monoclonal antibody against human Insulin-like growth factor I'),(292,75,0,113,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\"></div>'),(303,75,0,172,'Clonality - Polyclonal<br />Target - Parvalbumin<br />Quantities - available200 &micro;l, 500 &micro;l, 1 ml<br />Host - Rabbit<br />Antibody - Polyclonal<br />Isotype - various<br />Origin - Antiserum<br />Delivery - Formlyophilized<br />Application FieldNeuroscience, muscular &amp; kidney research'),(304,75,0,173,'<strong>Clonality :</strong> Monoclonal<br /><strong>Target<strong>&nbsp;:</strong></strong> Parvalbumin<br /><strong>Quantities<strong>&nbsp;:</strong></strong> available 100 &micro;l<br /><strong>Host<strong>&nbsp;:</strong></strong> Mouse Hybridoma Cells<br /><strong>Antibody<strong>&nbsp;:</strong></strong> Monoclonal<br /><strong>Isotype<strong>&nbsp;:</strong></strong> IgG1<br /><strong>Origin<strong>&nbsp;:</strong></strong> HPLC purified<br /><strong>Delivery<strong>&nbsp;:</strong></strong> Form lyophilized<br /><strong>Antibody<strong>&nbsp;:</strong></strong> Concentration 0.755 mg/ml<br /><strong>Application<strong>&nbsp;:</strong></strong> Field Neuroscience, muscular &amp; kidney research');
