  `final_price` decimal(12,4) DEFAULT NULL COMMENT 'Final Price',
  `min_price` decimal(12,4) DEFAULT NULL COMMENT 'Min Price',
  `max_price` decimal(12,4) DEFAULT NULL COMMENT 'Max Price',
  `tier_price` decimal(12,4) DEFAULT NULL COMMENT 'Tier Price',
  PRIMARY KEY (`entity_id`,`customer_group_id`,`website_id`,`store_id`),
  KEY `CATALOG_PRODUCT_INDEX_PRICE_STORE_WEBSITE_ID` (`website_id`),
  KEY `CATALOG_PRODUCT_INDEX_PRICE_STORE_CUSTOMER_GROUP_ID` (`customer_group_id`),
  KEY `CATALOG_PRODUCT_INDEX_PRICE_STORE_MIN_PRICE` (`min_price`),
  KEY `CAT_PRD_IDX_PRICE_STORE_WS_ID_STORE_ID_CSTR_GROUP_ID_MIN_PRICE` (`website_id`,`store_id`,`customer_group_id`,`min_price`),
