ount-box-author\"&gt;\r\n&lt;div class=\"themetechmount-box-img\"&gt;&lt;span class=\"themetechmount-item-thumbnail\"&gt; &lt;span class=\"themetechmount-item-thumbnail-inner\"&gt;  &lt;/span&gt; &lt;/span&gt;&lt;/div&gt;\r\n&lt;div class=\"themetechmount-box-title\"&gt;\r\n&lt;h3 class=\"themetechmount-author-name\"&gt;&lt;/h3&gt;\r\n&lt;span class=\"themetechmount-box-footer\"&gt; &lt;/span&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/article&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;p&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;style&gt;\r\nimg.attachment-thumbnail.size-thumbnail.wp-post-image {\r\n    width: 60px;\r\n    height: 60px;\r\n    border-radius: 30px;\r\n    float: left;\r\n}\r\narticle.themetechmount-box.themetechmount-box-testimonial.themetechmount-testimonialbox-styleone {\r\n    padding: 50px 60px;\r\n    background: #fff;\r\n}\r\n.themetechmount-box-title {\r\n    position: relative;\r\n    left: 15px;\r\n    font-size: 17px;\r\n    top: 7px;\r\n}\r\n.themetechmount-box-desc {\r\n    font-size: 18px;\r\n    position: relative;\r\n    bottom: 25px;\r\n}\r\n.themetechmount-testimonialbox-styleone .themetechmount-testimonial-text:before {\r\n    content: \'\';\r\n    background: #e7e7e7;\r\n    height: 100%;\r\n    width: 2px;\r\n    display: block;\r\n    position: absolute;\r\n    top: 0;\r\n    bottom: auto;\r\n    left: -10px;\r\n}\r\n.themetechmount-testimonial-text {\r\n    position: relative;\r\n    padding: 20px;\r\n}\r\n.widget.block.block-static-block {\r\n    background: #f5f5f5;\r\n}\r\nh3.themetechmount-author-name {\r\n    font-weight: bolder;\r\n}\r\n.themetechmount-testimonialbox-styleone .themetechmount-post-item:after {\r\n    content: \'\';\r\n    border-style: solid;\r\n    border-width: 57px 39px 0 0;\r\n    border-color: #fff transparent transparent transparent;\r\n    position: absolute;\r\n    bottom: -57px;\r\n    top: auto;\r\n    left: 15px;\r\n    right: auto;\r\n    z-index: 1;\r\n}\r\n.col-sm-12.col-xs-12.col-md-4.col-lg-4 {\r\n    height: max-content !important;\r\n}\r\n&lt;/style&gt;</div></div></div>','2022-07-08 04:25:13','2022-07-20 15:12:53',1,0,NULL,'','',NULL,NULL,NULL,NULL,''),(41,'Contact Us','cms-full-width','','','contact-us','','<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">{{widget type=\"Magento\\Cms\\Block\\Widget\\Block\" template=\"widget/static_block/default.phtml\" block_id=\"10\"}}\r\n</div>','2022-07-20 07:23:36','2022-07-26 11:33:33',1,0,NULL,'','',NULL,NULL,NULL,NULL,''),(42,'Ordering','cms-full-width','','','ordering','','<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"container\"&gt;\r\n   &lt;div class=\"contact-parent\"&gt;\r\n      &lt;div class=\"contact-child child1\"&gt;\r\n&lt;br&gt;\r\n&lt;h2&gt;&lt;b&gt;Ordering info&lt;/b&gt;&lt;/h2&gt;\r\n&lt;br&gt;\r\n &lt;p&gt;The placement of an order by e-mail is preferred. Information respecting the prices of our products in USD, EURO and CHF can be found on our homepage under «&lt;a href=\"?p=products\"&gt;Product &amp;amp; Prices&lt;/a&gt;».&lt;/p&gt;\r\n&lt;p&gt;On the receipt of the following information, we can prepare your order:&lt;/p&gt;\r\n&lt;ol&gt;\r\n&lt;li&gt;Name, e-mail address and telephone number of the person placing the order.&lt;/li&gt;\r\n&lt;li&gt;Name and e-mail address and telephone number of the scientist(s) who will utilize the product (if different from that given in 1.)&lt;/li&gt;\r\n&lt;li&gt;Purchase order number (for credit card information see below)&lt;/li&gt;\r\n&lt;li&gt;Product code, description and quantity&lt;/li&gt;\r\n&lt;li&gt;Shipping address (including telephone number, important for door to door transport by carriers like FedEx and DHL)&lt;/li&gt;\r\n&lt;li&gt;Mode of shipment : registered priority mail - for Swiss customers only / or carrier (e.g. FedEx, DHL) If possible, provide your own FedEx or DHL account number.&lt;/li&gt;\r\n&lt;li&gt;Billing address (including e-mail address and telephone number)&lt;/li&gt;\r\n&lt;li&gt;Manner of payment: wire transfer or credit card. There is no need to provide credit card details via e-mail. We will send you a link for payment via e-mail.&lt;/li&gt;\r\n&lt;li&gt;Swant does not accept payment by check. Please note that the PO alone gives no information about the manner of payment.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;p&gt;For &lt;strong&gt;EUROPE&lt;/strong&gt;: If you prefer to have your product delivered rapidly by, for example FedEx or DHL,&amp;nbsp;kindly provide&amp;nbsp;your account number (e.g. for FedEx the 9 digit number: 0000-0000-0).&lt;/p&gt;\r\n&lt;p&gt;For &lt;strong&gt;USA&lt;/strong&gt; or &lt;strong&gt;OTHER COUNTRIES&lt;/strong&gt;: We ship only with FedEx or DHL.&amp;nbsp;Kindly provide your account number or note if we should use the Swant FedEx / DHL account.&lt;/p&gt;\r\n&lt;p&gt;Since the placement of an order electronically is considered to be reliable, its receipt will not be confirmed, unless for an automatic replay when Swant is closed for holidays.&lt;/p&gt;\r\n&lt;br&gt;\r\n&lt;h3&gt;&lt;b&gt;Payment&lt;b&gt;&lt;/h3&gt;\r\n&lt;br&gt;\r\n&lt;p&gt;Payment has to be made within 30 days of the date of the invoice. Payment has to be done by wire transfer or credit card (no payment by check is accepted).&lt;/p&gt;\r\n&lt;p&gt;Payment can also be made by a bank transfer, in which case the client is liable for all supplementary charges, including those of the intermediary banks.&lt;/p&gt;\r\n&lt;p&gt;&lt;em&gt;Payment by check are not accepted.&lt;br&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;We ask a pre-payment to first time client and to those with whom we had difficulty getting paid.&lt;/p&gt;\r\n&lt;p&gt;Eventual Swant credit notes are not dated and can be used for a next order / payment.&lt;/p&gt;\r\n&lt;br&gt;\r\n&lt;h3&gt;&lt;b&gt;Shipment&lt;/b&gt;&lt;/h3&gt;\r\n&lt;p&gt;Swant lyophilized products are sent at room temperature by DHL or FedEx (USA: 100,00 USD, Europe 50,00 EUR).&lt;/p&gt;\r\n&lt;p&gt;Registered priority mail for Swiss customers only: 15,00 CHF&lt;/p&gt;\r\n&lt;p&gt;A copy of the bill and the tracking number of the shipment will be sent electronically to the client. It is the responsibility of the client to track the course of the shipment and, if necessary, to contact the answerable customs authorities.&lt;/p&gt;\r\n&lt;br&gt;\r\n&lt;h3&gt;&lt;b&gt;Prices and terms&lt;/b&gt;&lt;/h3&gt;\r\n&lt;br&gt;\r\n&lt;p&gt;All prices are quoted in US-dollars (USD), EUR (for Europe) and Swiss francs (CHF for Switzerland) at fixed exchange rate. Prices are subject to changes without notification.&lt;/p&gt;\r\n&lt;br&gt;\r\n&lt;h3&gt;&lt;b&gt;Accepted methods of payment&lt;/b&gt;&lt;/h3&gt;\r\n&lt;br&gt;   \r\n&lt;p&gt;&lt;strong&gt;CREDIT CARD&lt;/strong&gt;: for Europe additional administrative charges EUR 40; for USA and other countries: administrative charges USD 45-65 for one or two products.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;WIRE TRANSFER&lt;/strong&gt;: for Europe additional administrative charges EUR 40; for USA and other countries: administrative charges USD 40. The client is liable for all charges, including those of intermediary banks.&lt;/p&gt;\r\n&lt;p&gt;&lt;em&gt;Checks are not accepted !&lt;br&gt;&lt;/em&gt;&lt;/p&gt;      \r\n&lt;br&gt;\r\n&lt;h3&gt;&lt;b&gt;Returns&lt;/b&gt;&lt;/h3&gt;\r\n&lt;br&gt;\r\n&lt;p&gt;Please contact us (&lt;a href=\"mailto:info@swant.com\" target=\"_blank\" rel=\"noopener noreferrer\"&gt;info@swant.com&lt;/a&gt;) by e-mail &lt;strong&gt;within a month&lt;/strong&gt; of receiving the product if you experience any problems with, or have any queries respecting your order. No returns will be accepted thereafter without prior authorization.&lt;/p&gt;      \r\n&lt;br&gt;\r\n&lt;h3&gt;&lt;a id=\"customer\" name=\"customer\"&gt;&lt;/a&gt;&lt;b&gt;Customer service&lt;/b&gt;&lt;/h3&gt;\r\n&lt;br&gt;\r\n&lt;p&gt;If you have any questions respecting the specifications of a product, its usage, storage or delivery, or if you require any additional technical or scientific information, please feel free to contact us by e-mail. We will be happy to help you with your inquiries. If you experience any difficulties with immunostaining or western blotting, it would be helpful to us if you would complete the «&lt;strong&gt;Technical service walkthrough&lt;/strong&gt;» questionnaire under the relevant heading:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;&lt;a href=\"?p=tsw_immunostaining\"&gt;Immunostaining&lt;/a&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;a href=\"?p=tsw_western_blot\"&gt;Western blotting&lt;/a&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;br&gt;\r\n&lt;h3&gt;&lt;b&gt;Guarantee&lt;/b&gt;&lt;/h3&gt;\r\n&lt;br&gt;\r\n&lt;p&gt;We guarantee the quality of each item that is listed in the catalogue. This warranty is exclusive, Swant offers no other warranty, either expressed or implied; nor is there any implied warranty of fitness for any particular purpose. Swant Inc. is not liable for any incidental, consequential or contingent damages.&lt;/p&gt;\r\n&lt;br&gt;\r\n&lt;h2&gt;&lt;b&gt;Product use&lt;/b&gt;&lt;/h3&gt;\r\n&lt;br&gt;\r\n&lt;p&gt;The products listed in the catalogue are neither hazardous nor infectious. They are intended only for use in research, and should not be employed for clinical or therapeutic purposes.&lt;/p&gt;\r\n&lt;/div&gt;\r\n   &lt;/div&gt;\r\n&lt;/div&gt;</div>','2022-07-20 07:55:37','2022-07-20 08:29:12',1,0,NULL,'','',NULL,NULL,NULL,NULL,''),(43,'Methods','cms-full-width','','','methods','','<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"container\"&gt;\r\n    &lt;div class=\"contact-parent\"&gt;\r\n       &lt;div class=\"contact-child child1\"&gt;\r\n            &lt;div class=\"about-us\"&gt;\r\n\r\n                &lt;h1 class=\"title-shop-page\" style=\"margin: 20px 0px;\"&gt;Methods&lt;/h1&gt;\r\n&lt;div class = \"methods\"&gt;\r\n&lt;a href=\"{{media url=wysiwyg/pdf/1._Procedure_for_the_immunolabelling_of_sections_with_rabbit_antisera.pdf}}\" target=\"_blank\" download&gt;1. Procedure for the immunolabelling of sections\r\nwith rabbit antisera &lt;/a&gt;&lt;br&gt;&lt;br&gt;&lt;img src=\"{{media url=wysiwyg/PDF_file_icon-300x300_1_.jpg}}\" alt=\"\" /&gt;\r\n&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;a href=\"{{media url=wysiwyg/pdf/2._Procedure_for_the_immunolabelling_of_sections_with_goat_antisera.pdf}}\" target=\"_blank\" download&gt;2. Procedure for the immunolabelling of sections\r\nwith goat antisera &lt;/a&gt;&lt;br&gt;&lt;br&gt;&lt;img src=\"{{media url=wysiwyg/PDF_file_icon-300x300_1_.jpg}}\" alt=\"\" /&gt;\r\n&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;a href=\"{{media url=wysiwyg/pdf/3._Procedure_for_the_immunolabelling_of_sections_with_mouse_monoclonal_antibodies.pdf}}\" target=\"_blank\" download&gt;3. Procedure for the immunolabelling of sections\r\nwith mouse monoclonal antibodies &lt;/a&gt;&lt;br&gt;&lt;br&gt;&lt;img src=\"{{media url=wysiwyg/PDF_file_icon-300x300_1_.jpg}}\" alt=\"\" /&gt;\r\n&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;a href=\"{{media url=wysiwyg/pdf/4._Procedure_for_the_immunolabelling_of_sections_with_Guinea_pig_antisera.pdf}}\" target=\"_blank\" download&gt;4. Procedure for the immunolabelling of sections\r\nwith Guinea pig antisera &lt;/a&gt;&lt;br&gt;&lt;br&gt;&lt;img src=\"{{media url=wysiwyg/PDF_file_icon-300x300_1_.jpg}}\" alt=\"\" /&gt;\r\n&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;a href=\"{{media url=wysiwyg/pdf/5._Immunoblotting_Method.pdf}}\" target=\"_blank\" download&gt;5. Immunoblotting Method &lt;/a&gt;&lt;br&gt;&lt;br&gt;&lt;img src=\"{{media url=wysiwyg/PDF_file_icon-300x300_1_.jpg}}\" alt=\"\" /&gt;\r\n&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;/div&gt;\r\n\r\n\r\n&lt;!--\r\n\r\n\r\n                &lt;h2 style=\"font-weight: 600;margin: 20px 0px;\"&gt;Procedure for the immunolabelling of sections with rabbit antisera&lt;/h2&gt;\r\n\r\n                &lt;div class=\"top-about-us\"&gt;\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Material&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;ul&gt;\r\n                                    &lt;li&gt;Free-floating cryostate or vibratome sections (40-80 µm) of fixed tissue* (4% paraformaldehyde in 0.1 M phosphate buffer, pH 7.4) or paraffin sections (3-5 µm) of tissue fixed with 10% unbuffered formalin.&lt;/li&gt;\r\n                                    &lt;li&gt;0.1M Tris-buffered saline (TBS) pH 7.3.&lt;/li&gt;\r\n                                    &lt;li&gt;&lt;strong&gt;SWant rabbit antiserum.&lt;/strong&gt;&lt;/li&gt;\r\n                                    &lt;li&gt;Biotinylated anti-rabbit IgG.&lt;/li&gt;\r\n                                    &lt;li&gt;Streptavidin-peroxidase or Streptavidin conjugated to CY2, Cy3, Cy5, or other fluorescent dyes.&lt;/li&gt;\r\n                                    &lt;li&gt;Peroxidase substrate (e.g. Diaminobenzidine(HCl) and H2O2).&lt;/li&gt;\r\n                                    &lt;li&gt;Ethanol and Xylol.&lt;/li&gt;\r\n                                    &lt;li&gt;Mounting medium (e.g. Eukitt for immunhistochemistry, Hydromount for immunofluorescence).&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Method&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;ul&gt;\r\n                                    &lt;li&gt;Apply the SWant rabbit-antiserum diluted 1:1\'000-1:5\'000 (paraffin sections) or 1:5\'000-1:10\'000 (floating sections) in TBS with 10% carrier serum (e.g. calf or horse serum) and eventually 0.2% Triton-X 100 (particularly for vibratome sections). Incubate for 1 to 3 days at 4°C (on a shaker for free-floating sections, in a humid chamber for paraffin sections).&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Apply biotinylated anti-rabbit IgG-biotin (diluted according to the suggestions of the supplier) in TBS with 10% carrier serum. Incubate at room temperature (RT) for 1 to 4 hours.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Apply the streptavidine-biotin-peroxidase complex (diluted according to the suggestions of the supplier) or the Streptavidine-fluorescent complex in TBS with 10% carrier serum. Incubate for 1 to 2 hours at RT.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;The immunofluorescent labelling is terminated at this point and the section can be mounted on slides and coverslipped with an aqueous medium (e.g. Hydromount).&lt;/li&gt;\r\n                                    &lt;li&gt;The immunohistochemical reaction is concluded by treating the section with a peroxidase substrate (e.g. Diaminobenzidine HCl / H2O2 ) under continuous microscopic observation.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Mount free floating sections on slides, eventually counterstain with cresyl-violet.&lt;/li&gt;\r\n                                    &lt;li&gt;Dehydrate immunohistochemically treated sections with ethanol and xylol. Add mounting medium (Eukitt) and coverslip.&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                                    &lt;p&gt;&lt;u&gt;Note&lt;/u&gt; : in case of excessive background-staining, use &lt;strong&gt;higher dilutions&lt;/strong&gt; of the SWant rabbit antiserum.&lt;/p&gt;\r\n                                    &lt;p&gt;&lt;strong&gt;* Without prior fixation the highly soluble Ca&lt;sup&gt;2+&lt;/sup&gt;-binding proteins are immediately lost during sectioning. &lt;/strong&gt;&lt;/p&gt;\r\n                                    &lt;br&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n                &lt;/div&gt;\r\n\r\n                &lt;h2 style=\"font-weight: 600;margin: 20px 0px;\"&gt;Procedure for the immunolabelling of sections with goat antisera&lt;/h2&gt;\r\n\r\n                &lt;div class=\"top-about-us\"&gt;\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Material&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;ul&gt;\r\n                                    &lt;li&gt;Free-floating cryostate or vibratome sections (40-80 µm) of fixed tissue* (4% paraformaldehyde in 0.1 M phosphate buffer, pH 7.4) or paraffin sections (3-5 µm) of tissue fixed with 10% unbuffered formalin.&lt;/li&gt;\r\n                                    &lt;li&gt;0.1M Tris-buffered saline (TBS) pH 7.3.&lt;/li&gt;\r\n                                    &lt;li&gt;&lt;strong&gt;SWant goat antiserum.&lt;/strong&gt;&lt;/li&gt;\r\n                                    &lt;li&gt;Biotinylated anti-goat IgG.&lt;/li&gt;\r\n                                    &lt;li&gt;Streptavidin-peroxidase or Streptavidin conjugated to CY2, Cy3, Cy5, or other fluorescent dyes.&lt;/li&gt;\r\n                                    &lt;li&gt;Peroxidase substrate (e.g. Diaminobenzidine(HCl) and H2O2).&lt;/li&gt;\r\n                                    &lt;li&gt;Ethanol and Xylol.&lt;/li&gt;\r\n                                    &lt;li&gt;Mounting medium (e.g. Eukitt for immunhistochemistry, Hydromount for immunofluorescence).&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Method&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;ul&gt;\r\n                                    &lt;li&gt;Apply the SWant goat-antiserum diluted 1:1\'000-1:5\'000 (paraffin sections) or 1:5\'000-1:10\'000 (floating sections) in TBS with 10% carrier serum (e.g. calf or horse serum) and eventually 0.2% Triton-X 100 (particularly for vibratome sections). Incubate for 1 to 3 days at 4°C (on a shaker for free-floating sections, in a humid chamber for paraffin sections).&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Apply biotinylated anti-goat IgG-biotin (diluted according to the suggestions of the supplier) in TBS with 10% carrier serum. Incubate at room temperature (RT) for 1 to 4 hours.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Apply the streptavidine-biotin-peroxidase complex (diluted according to the suggestions of the supplier) or the Streptavidine-fluorescent complex in TBS with 10% carrier serum. Incubate for 1 to 2 hours at RT.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;The immunofluorescent labelling is terminated at this point and the section can be mounted on slides and coverslipped with an aqueous medium (e.g. Hydromount).&lt;/li&gt;\r\n                                    &lt;li&gt;The immunohistochemical reaction is concluded by treating the section with a peroxidase substrate (e.g. Diaminobenzidine HCl / H2O2 ) under continuous microscopic observation.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Mount free floating sections on slides, eventually counterstain with cresyl-violet.&lt;/li&gt;\r\n                                    &lt;li&gt;Dehydrate immunohistochemically treated sections with ethanol and xylol. Add mounting medium (Eukitt) and coverslip.&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                                    &lt;br&gt;\r\n                                    &lt;p&gt;&lt;u&gt;Note&lt;/u&gt;: in case of excessive background-staining use &lt;strong&gt;higher dilutions&lt;/strong&gt; of the SWant goat antiserum.&lt;/p&gt;\r\n                                    &lt;p&gt;&lt;strong&gt;* Without prior fixation the highly soluble Ca&lt;sup&gt;2+&lt;/sup&gt;-binding proteins are immediately lost during sectioning.&lt;/strong&gt;&lt;/p&gt;\r\n                                    &lt;br&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n                &lt;/div&gt;\r\n\r\n\r\n                \r\n                &lt;h2 style=\"font-weight: 600;margin: 20px 0px;\"&gt;Procedure for the immunolabelling of sections with mouse monoclonal antibodies&lt;/h2&gt;\r\n\r\n                &lt;div class=\"top-about-us\"&gt;\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Material&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;ul&gt;\r\n                                    &lt;li&gt;Free-floating cryostate or vibratome sections (40-80 µm) of fixed tissue* (4% paraformaldehyde in 0.1 M phosphate buffer, pH 7.4) or paraffin sections (3-5 µm) of tissue fixed with 10% unbuffered formalin.&lt;/li&gt;\r\n                                    &lt;li&gt;0.1M Tris-buffered saline (TBS) pH 7.3.&lt;/li&gt;\r\n                                    &lt;li&gt;&lt;strong&gt;SWant monoclonal mouse antiserum.&lt;/strong&gt;&lt;/li&gt;\r\n                                    &lt;li&gt;Biotinylated anti-mouse IgG.&lt;/li&gt;\r\n                                    &lt;li&gt;Streptavidin-peroxidase or Streptavidin conjugated to CY2, Cy3, Cy5, or other fluorescent dyes.&lt;/li&gt;\r\n                                    &lt;li&gt;Peroxidase substrate (e.g. Diaminobenzidine(HCl) and H2O2).&lt;/li&gt;\r\n                                    &lt;li&gt;Ethanol and Xylol.&lt;/li&gt;\r\n                                    &lt;li&gt;Mounting medium (e.g. Eukitt for immunhistochemistry, Hydromount for immunofluorescence).&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Method&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;ul&gt;\r\n                                    &lt;li&gt;Apply the SWant mouse-antiserum diluted 1:1\'000-1:5\'000 (paraffin sections) or 1:5\'000-1:10\'000 (floating sections) in TBS with 10% carrier serum (e.g. calf or horse serum) and eventually 0.2% Triton-X 100 (particularly for vibratome sections). Incubate for 1 to 3 days at 4°C (on a shaker for free-floating sections, in a humid chamber for paraffin sections).&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Apply biotinylated anti-mouse IgG-biotin (diluted according to the suggestions of the supplier) in TBS with 10% carrier serum. Incubate at room temperature (RT) for 1 to 4 hours.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Apply the streptavidine-biotin-peroxidase complex (diluted according to the suggestions of the supplier) or the Streptavidine-fluorescent complex in TBS with 10% carrier serum. Incubate for 1 to 2 hours at RT.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;The immunofluorescent labelling is terminated at this point and the section can be mounted on slides and coverslipped with an aqueous medium (e.g. Hydromount).&lt;/li&gt;\r\n                                    &lt;li&gt;The immunohistochemical reaction is concluded by treating the section with a peroxidase substrate (e.g. Diaminobenzidine HCl / H2O2 ) under continuous microscopic observation.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Mount free floating sections on slides, eventually counterstain with cresyl-violet.&lt;/li&gt;\r\n                                    &lt;li&gt;Dehydrate immunohistochemically treated sections with ethanol and xylol. Add mounting medium (Eukitt) and coverslip.&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                                    &lt;br&gt;\r\n                                    &lt;p&gt;&lt;u&gt;Note&lt;/u&gt; : in case of excessive background-staining, use &lt;strong&gt;higher dilutions&lt;/strong&gt; of the SWant mouse antiserum.&lt;/p&gt;\r\n                                    &lt;p&gt;&lt;strong&gt;* Without prior fixation the highly soluble Ca&lt;sup&gt;2+&lt;/sup&gt;-binding proteins are immediately lost during sectioning.&lt;/strong&gt;&lt;/p&gt;\r\n                                    &lt;br&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n                &lt;/div&gt;\r\n\r\n\r\n                &lt;h2 style=\"font-weight: 600;margin: 20px 0px;\"&gt;Procedure for the immunolabelling of sections with Guinea pig antisera&lt;/h2&gt;\r\n\r\n                &lt;div class=\"top-about-us\"&gt;\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Material&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;ul&gt;\r\n                                    &lt;li&gt;Free-floating cryostat or vibratome sections (fixed with 4% paraformaldehyde in 0.1 M phosphate buffer, pH 7.4) or paraffin sections of tissue fixed with Bouin’s fluid or 10% formalin.&lt;/li&gt;\r\n                                    &lt;li&gt;0.1M Tris-buffered saline (TBS) pH 7.3.&lt;/li&gt;\r\n                                    &lt;li&gt;SWant guinea-pig antiserum.&lt;/li&gt;\r\n                                    &lt;li&gt;Biotinylated anti-guinea pig IgG.&lt;/li&gt;\r\n                                    &lt;li&gt;Avidin-peroxidase (or streptavidin-fluorescence dye [e.g. Cy2 or Alexa 488])&lt;/li&gt;\r\n                                    &lt;li&gt;Peroxidase substrate (e.g. Diaminobenzidine-HCl and H2O2 for immunoperoxidase.&lt;/li&gt;\r\n                                    &lt;li&gt;Ethanol and Xylol (only for immunoperoxidase).&lt;/li&gt;\r\n                                    &lt;li&gt;Mounting medium [Pertex, Histolab] for immunoperoxidase), [Hydromount, National Diagnostic] (for immunofluorescence).&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                                    &lt;br&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Method&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;ul&gt;\r\n                                    &lt;li&gt;Apply the SWant antiserum diluted 1:1\'000-1:5\'000 (paraffin sections) or 1:5\'000- 1:10\'000 (floating sections) in TBS with 10% carrier serum (e.g. calf or horse serum) and 0.1-0.2% Triton-X 100. Incubate for 1 to 3 days at 4°C (on a shaker for free-floating sections, in a humid chamber at 4°C for paraffin sections).&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Apply biotinylated-anti guinea pig IgG (diluted according to the suggestions of the supplier) in TBS, with 10% carrier serum. Incubate at room temperature (RT) for 2 to 4 hours.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Apply the avidin-biotin-peroxidase complex (diluted according to the suggestions of the supplier) or Streptavidine-fluorophore (e.g. Cy2 or Alexa 488) in TBS with 10% carrier serum. Incubate for 1 to 2 hours at RT.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;For immunoperoxidase: treat the section with a peroxidase substrate (e.g. Diaminobenzidine-HCl / H2O2).&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Mount free floating sections on slides, eventually counterstain with cresyl-violet.&lt;/li&gt;\r\n                                    &lt;li&gt;For immunoperoxidase-staining dehydrate with ethanol and xylol and mount and coverslip in Entellan. For immunofluorescence-staining mount and coverslip in Hydromount.&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                                    &lt;p&gt;&lt;u&gt;Note&lt;/u&gt; : in case of excessive background-staining use higher dilutions of the SWant antibodies.&lt;/p&gt;\r\n                                    &lt;br&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n                &lt;/div&gt;\r\n\r\n\r\n\r\n                &lt;h2 style=\"font-weight: 600;margin: 20px 0px;\"&gt;Immunoblotting Method&lt;/h2&gt;\r\n\r\n                &lt;div class=\"top-about-us\"&gt;\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Samples&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;p&gt;Protein extraction performed in a buffer consisting of: Tris 10mM, EDTA1mM, proteases inhibitors pH 7.4 (e.g. Protease inhibitor Kit of Quartett, Germany or cOmplete of Roche-Sigma (cat. Nr. 04693159001 Roche).&lt;/p&gt;\r\n                                &lt;p&gt;The extraction of the proteins from the tissue is done in the above buffer by sonication (2 x 10 seconds on ice, followed by centrifugation at 14’000 rpm, during 10 min at 4°C).&lt;/p&gt;\r\n                                &lt;br&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Sample loading&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;p&gt;30 to 50 ug proteins / lane&lt;/p&gt;\r\n                                &lt;p&gt;Controls: cerebellum or muscle (EDL: extensor digitorum longus)&lt;/p&gt;\r\n                                &lt;p&gt;SDS-gel: 12 or 15% SDS-polyacrylamide gel&lt;/p&gt;\r\n                                &lt;br&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Transfer of the protein&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;p&gt;Semi-dry for 1h, with 60mA / membrane.&lt;/p&gt;\r\n                                &lt;p&gt;Transfer buffer: Tris Base 25mM,Glycine 192mM (pH8.3) 200 ml methanol&amp;nbsp;for 1L.&lt;/p&gt;\r\n                                &lt;p&gt;Primary and secondary antibodies: primary antibody at a dilution of 1:2’000 to 1:10’000 in 2% milk/TBST, 4°C overnight.&lt;/p&gt;\r\n                                &lt;p&gt;Secondary antibodies (e.g. rabbit) Sigma A0545, diluted 1:10’000, 2h at room temperature, 2&amp;amp; milk/TBST&lt;/p&gt;\r\n                                &lt;br&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"our-member\" &gt;&lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Detection system&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;p&gt;Luminata forte (Millipore) or WesternBright Quantum of Advansta&lt;/p&gt;\r\n&lt;p&gt;Important for taking pictures with an automatic camera: if you have very strong bands in the upper molecular weight, hide them with a sheet of black paper and repeat the detection there were at first sight you had no band (e.g. 12 KDa).&lt;/p&gt;\r\n\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n\r\n\r\n                &lt;/div&gt;--&gt;\r\n\r\n\r\n\r\n            &lt;/div&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n</div>','2022-07-20 09:21:30','2023-02-17 12:58:36',1,0,NULL,'','',NULL,NULL,NULL,NULL,''),(44,'Methods Demo','cms-full-width','','','methods-63087955dbe18','','<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"container\"&gt;\r\n    &lt;div class=\"contact-parent\"&gt;\r\n       &lt;div class=\"contact-child child1\"&gt;\r\n            &lt;div class=\"about-us\"&gt;\r\n                &lt;h1 class=\"title-shop-page\"&gt;Methods&lt;/h1&gt;\r\n\r\n                &lt;strong&gt;Procedure for the immunolabelling of sections with rabbit antisera&lt;/strong&gt;\r\n\r\n\r\n                &lt;div class=\"top-about-us\"&gt;\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Material&lt;/strong&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;ul&gt;\r\n                                    &lt;li&gt;Free-floating cryostate or vibratome sections (40-80 µm) of fixed tissue* (4% paraformaldehyde in 0.1 M phosphate buffer, pH 7.4) or paraffin sections (3-5 µm) of tissue fixed with 10% unbuffered formalin.&lt;/li&gt;\r\n                                    &lt;li&gt;0.1M Tris-buffered saline (TBS) pH 7.3.&lt;/li&gt;\r\n                                    &lt;li&gt;&lt;strong&gt;SWant rabbit antiserum.&lt;/strong&gt;&lt;/li&gt;\r\n                                    &lt;li&gt;Biotinylated anti-rabbit IgG.&lt;/li&gt;\r\n                                    &lt;li&gt;Streptavidin-peroxidase or Streptavidin conjugated to CY2, Cy3, Cy5, or other fluorescent dyes.&lt;/li&gt;\r\n                                    &lt;li&gt;Peroxidase substrate (e.g. Diaminobenzidine(HCl) and H2O2).&lt;/li&gt;\r\n                                    &lt;li&gt;Ethanol and Xylol.&lt;/li&gt;\r\n                                    &lt;li&gt;Mounting medium (e.g. Eukitt for immunhistochemistry, Hydromount for immunofluorescence).&lt;/li&gt;\r\n                                &lt;/ul&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n\r\n                    &lt;div class=\"row\"&gt;\r\n                        &lt;div class=\"col-lg-12\"&gt;\r\n                            &lt;div class=\"title-bonus\"&gt;&lt;strong&gt;Method&lt;/strong&gt;&lt;/div&gt;\r\n                            &lt;div class=\"top-shop-info\"&gt;\r\n                                &lt;ol&gt;\r\n                                    &lt;li&gt;Apply the SWant rabbit-antiserum diluted 1:1\'000-1:5\'000 (paraffin sections) or 1:5\'000-1:10\'000 (floating sections) in TBS with 10% carrier serum (e.g. calf or horse serum) and eventually 0.2% Triton-X 100 (particularly for vibratome sections). Incubate for 1 to 3 days at 4°C (on a shaker for free-floating sections, in a humid chamber for paraffin sections).&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Apply biotinylated anti-rabbit IgG-biotin (diluted according to the suggestions of the supplier) in TBS with 10% carrier serum. Incubate at room temperature (RT) for 1 to 4 hours.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Apply the streptavidine-biotin-peroxidase complex (diluted according to the suggestions of the supplier) or the Streptavidine-fluorescent complex in TBS with 10% carrier serum. Incubate for 1 to 2 hours at RT.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;The immunofluorescent labelling is terminated at this point and the section can be mounted on slides and coverslipped with an aqueous medium (e.g. Hydromount).&lt;/li&gt;\r\n                                    &lt;li&gt;The immunohistochemical reaction is concluded by treating the section with a peroxidase substrate (e.g. Diaminobenzidine HCl / H2O2 ) under continuous microscopic observation.&lt;/li&gt;\r\n                                    &lt;li&gt;Rinse in TBS 3 x 5 min.&lt;/li&gt;\r\n                                    &lt;li&gt;Mount free floating sections on slides, eventually counterstain with cresyl-violet.&lt;/li&gt;\r\n                                    &lt;li&gt;Dehydrate immunohistochemically treated sections with ethanol and xylol. Add mounting medium (Eukitt) and coverslip.&lt;/li&gt;\r\n                                    &lt;/ol&gt;\r\n                                    &lt;p&gt;&lt;u&gt;Note&lt;/u&gt; : in case of excessive background-staining, use &lt;strong&gt;higher dilutions&lt;/strong&gt; of the SWant rabbit antiserum.&lt;/p&gt;\r\n                                    &lt;p&gt;&lt;strong&gt;* Without prior fixation the highly soluble Ca&lt;sup&gt;2+&lt;/sup&gt;-binding proteins are immediately lost during sectioning. &lt;/strong&gt;&lt;/p&gt;\r\n                                    &lt;br&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n                &lt;/div&gt;\r\n\r\n            &lt;/div&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n</div>','2022-07-20 09:21:30','2022-08-26 10:17:35',1,0,NULL,'','',NULL,NULL,NULL,NULL,''),(45,'General terms and conditions','cms-full-width','','','general-terms-and-conditions','','<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;div class = \"container\"&gt;\r\n&lt;p&gt;&lt;b&gt;General terms and conditions of Swant AG, Burgdorf&lt;/b&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;b&gt;Web shop version&lt;/b&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;b&gt;1. General&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;p&gt;1.1 The subject of these terms of use is the relationship between Swant and the users of Swant products (henceforth: Products).&lt;/p&gt;\r\n&lt;p&gt;1.2 All of our sales, deliveries and services are based exclusively on the following conditions. Changes and additions must be in writing. None of the contractual partner\'s general terms and conditions apply unless this has been expressly agreed in writing in individual cases.&lt;/p&gt;\r\n&lt;p&gt;1.3 Our offer is not aimed at natural persons, but at entrepreneurs, legal entities under public law or public law institutions.&lt;/p&gt;&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;b&gt;2. Conclusion of contract&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;p&gt;2.1 The products and prices in the online shop count as offers. However, this offer is always subject to the contract-dissolving condition of an impossibility of delivery or an incorrect pricing.&lt;/p&gt;\r\n&lt;p&gt;2.2 By clicking the order button you place a binding order for the products contained in the shopping cart. The receipt of the order is confirmed together with the acceptance of the order immediately after sending it by automated email. The contract is concluded with this email confirmation&lt;/p&gt;&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;b&gt;3. Prices and terms of payment&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;p&gt;3.1 The published prices in the online shop are binding.&lt;/p&gt;\r\n&lt;p&gt;3.2 All additional costs such as insurance, customs duties, taxes, export, import or other permits, bank fees and the like are borne by the client.&lt;/p&gt;\r\n&lt;p&gt;3.3 Currency: SWANT accepts only CHF, Euro and USD (only on request and prepayment) as a means of payment&lt;/p&gt;\r\n&lt;p&gt;\r\n3.4 The following means of payment are available to the customer:\r\n&lt;/p&gt;\r\n&lt;p&gt;3.4.1 Prepayment: The customer receives the payment information after placing the order. With prepayment, delivery will only take place after receipt of payment. The delivery period begins when payment is received. The products in the RCG warehouse are reserved until the maximum payment period of 10 calendar days has expired.&lt;/p&gt;\r\n&lt;p&gt;3.4.2 Credit card: When paying by credit card, the debit is made when ordering.&lt;/p&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;b&gt;4. Delivery&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;p&gt;4.1 If the order volume is high, the delivery times shown in the online shop may differ from the actual delivery times. Only the delivery times of our goods specified in the definitive order confirmation are for SWANT delivery times in the online shop are only guidelines and can vary up to 10 days.&lt;/p&gt;\r\n&lt;p&gt;4.2 Unless otherwise agreed in writing, the customer can withdraw from the contract in the event of a delay in delivery of 60 days and after a written reminder, whereby claims for damages of any kind are excluded.&lt;/p&gt;\r\n&lt;p&gt;4.3 The delivery is considered fulfilled when the goods leave the SWANT. The risk of the goods passes to the customer when the goods are transferred to the carrier. The packaging is done with the best care.&lt;/p&gt;\r\n&lt;p&gt;4.4 SWANT is also entitled to provide the service owed by it in partial deliveries. The delivered goods remain the property of SWANT until all claims from the order processing have been paid in full.&lt;/p&gt;\r\n&lt;p&gt;4.5 The risk passes to the client upon conclusion of the contract (Art. 185 OR).&lt;/p&gt;\r\n&lt;p&gt;4.6 The processing time of the orders depends on their type and scope. It is assured that it will be completed as quickly as possible. Unpredictable personnel or equipment failures release Swant from adhering to agreed delivery times and preclude any claims for compensation that may result&lt;/p&gt;&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;b&gt;5. Late payment&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;p&gt;5.1 If the customer is completely or partially in arrears with the payment or if insolvency proceedings are opened against the client\'s assets, Swant can demand immediate payment of all claims regardless of the agreed payment terms or accepted bills of exchange.&lt;/p&gt;&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;b&gt;6. Guarantee and liability&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;p&gt;6.1 Unless otherwise agreed, our products are only used for further processing, for research purposes. Our products must not be used as additives for food or feed, human or veterinary medicinal products or cosmetics and not for in vivo diagnostic purposes.&lt;/p&gt;\r\n&lt;p&gt;6.2 Unless otherwise agreed, SWANT is only liable for the careful execution of the chemical service. Liability for slight negligence or financial loss is categorically excluded. If an order is placed in the name and at the expense of a third party, the representative and the representative are jointly and severally liable to Swant for the fulfillment of all corresponding obligations. Under no circumstances is SWANT liable for consequential damage and lost profits.&lt;/p&gt;\r\n&lt;p&gt;6.3 Expiry dates on our labels and / or certificates of analysis are only valid if the product is stored under the conditions defined by SWANT and the container is unopened and intact.&lt;/p&gt;\r\n&lt;p&gt;6.4 We reserve the right to slight deviations in the quality of the products ordered, particularly in terms of quantity and degree of purity, provided the deviations are customary in the trade from.&lt;/p&gt;\r\n&lt;p&gt;6.5 Our product information and consulting services are provided to the best of our knowledge. All information and services do not release the buyer from his obligation to inspect and test the products themselves and to examine their application for the respective use&lt;/p&gt;\r\n&lt;p&gt;6.6 SWANT\'s maximum liability for any reason is to replace a defective product or to refund the purchase price.&lt;/p&gt;&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;b&gt;7. Samples and security risks&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;p&gt;7.1 SWANT\'s products may fall under the Chemicals Prohibition Ordinance, the European Ordinance on Registration, Evaluation, Authorization and Restriction of Chemical Substances (REACH Ordinance) or other regulatory provisions. The client is responsible for compliance with the regulatory provisions for the storage, handling and use of substances purchased from SWANT.&lt;/p&gt;\r\n&lt;p&gt;7.2 SWANT does not guarantee the completeness of the information regarding toxicity, flammability and environmental damage of the chemicals sold. It is the responsibility of the client to take safety-related precautions, to pass them on to persons who come into contact\r\nwith the product and to inform themselves.&lt;/p&gt;&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;b&gt;8. Quality assurance and data backup&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;p&gt;8.1 Quality assurance and data backup of chemical services and the resulting substances and results&lt;/p&gt;\r\n&lt;p&gt;8.1.1 Tests are carried out according to the current state of the art. SWANT uses public or proprietary methods, unless the client requests otherwise. A wage analysis contract and product-specific validation are required for GMP-compliant order analysis.&lt;/p&gt;\r\n&lt;p&gt;8.1.2 Test reports / analysis certificates and raw data are archived for 10 years&lt;/p&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;b&gt;9. confidentiality&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;p&gt;9.1 SWANT undertakes to treat information, process information, analysis findings and procedures from the client\'s business area that are neither generally accessible nor known as confidential. Unless otherwise agreed in writing, SWANT will only communicate the results to the client. Disclosure of documents and information as part of official inspections in areas regulated by law is excluded from confidentiality.&lt;/p&gt;&lt;/ul&gt;\r\n&lt;p&gt;&lt;b&gt;10. Force Majeure&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;&lt;p&gt;10.1 If SWANT is prevented from fulfilling its contractual obligations, in particular from delivering the goods, due to force majeure, SWANT is released from the obligation to perform for the duration of the obstacle and a reasonable start-up period, without being obliged to compensate the customer. The same applies if SWANT is unacceptably difficult or temporarily impossible to fulfill its obligations due to unforeseeable circumstances for which SWANT is not responsible. Such circumstances include, but are not limited to, acts of God, floods or other natural disasters, fires, explosions, lockouts, industrial disputes, wars, riots, civil unrest, epidemics, embargoes, denial of export or import permits, delays in transport, official measures, lack of energy, delivery obstacles at a supplier or significant operational disruptions, unless otherwise expressly regulated by contract. SWANT is obliged to inform the customer immediately about such an obstacle, in particular to describe the obstacle in detail and to indicate the day of the occurrence of the obstacle and the presumed duration.&lt;/p&gt;\r\n&lt;p&gt;10.2 SWANT is entitled to withdraw from the contract if such an obstacle lasts more than ninety (90) days and the fulfillment of the contract is no longer of interest to SWANT as a result of the obstacle. At the request of the customer, SWANT will declare after the deadline whether they will exercise their right of withdrawal or deliver the goods within a reasonable period.&lt;/p&gt;\r\n&lt;p&gt;10.3 SWANT is not liable for damage to the customer, costs or expenses that are based on the fact that SWANT was unable to deliver the products and fulfill orders in good time due to the event.&lt;/p&gt;&lt;/ul&gt;\r\n&lt;p&gt;&lt;b&gt;11. Right of withdrawal&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;&lt;p&gt;11.1 The right of withdrawal only applies to credit card payments.&lt;/p&gt;\r\n&lt;p&gt;11.2 You have the right to cancel the order in writing to SWANT within 10 days of receiving the order confirmation, whereby the dealer cannot cancel the order if SWANT has already shipped the goods.&lt;/p&gt;&lt;/ul&gt;\r\n&lt;p&gt;&lt;b&gt;12. Place of jurisdiction&lt;/b&gt;&lt;/p&gt;\r\n&lt;ul&gt;&lt;p&gt;12.1 Swiss law is exclusively applicable to any disputes. The place of jurisdiction is Burgdorf, Switzerland&lt;/p&gt;\r\n&lt;/div&gt;&lt;/ul&gt;\r\n</div>','2022-12-15 06:30:25','2022-12-21 11:26:19',1,0,NULL,'','',NULL,NULL,NULL,NULL,'');
