INSERT INTO `pagebuilder_template` VALUES (1,'Description','.template-managerdescription62bc591073645.jpg','<style>#html-body [data-pb-style=J7PVD7T]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"J7PVD7T\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><p>Will you get the answers in time, or is that just WISHFUL THINKING? Let\'s see how quickly you make the connections in this fun and challenging board game. You only have 60 seconds to figure out three Mystery words on the card. The only thing they have in common is that they all begin with the same letter. You (and your teammates) are allowed as many guesses as you like</p>\n<p>Product Dimensions:<br>13 x 8 x 1 inches<br>Model Number:<br>O4633<br>Date First Available:<br>August 20, 2019<br>ASIN:<br>B07WWZM89C<br>Occasion:<br>Daily, Lounge, Fall, Shopping<br>INCLUDES 3 FUN PRINTABLES! Along with our learning games for kids ages 3-5, you get access to 3 FULL-COLOR, PRINTABLE downloads to READ, STORY is a fun illustrated journey through sustainable plant harvesting, endangered plants, ecosystems and more. The 27-page WILDCRAFT! BOTANICAL COLORING BOOK helps kids learn the plants in our educational game. And our POCKET GUIDE is the perfect reference to take on family nature outings, hikes and camping trips! AT LearningHerbs, WE BELIEVE IN THE POWER OF CONNECTING KIDS TO NATURE and appreciating everything OUR GREAT EARTH HAS TO OFFER. As parents, we designed Wildcraft! fun family games for kids.</p>\n<p>Wildcraft An Herbal Adventure Game is a fun, that’s also easy to follow – NO READING required. Because our learning board games feature clear illustrations and matching icons, even younger kids will learn w</p></div></div></div>','any','2022-06-29 13:52:16','2022-06-29 13:52:16'),(2,'New Template','.template-managernewtemplate62bc5980b83d5.jpg','<style>#html-body [data-pb-style=LKKAW7F]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"LKKAW7F\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><p>Will you get the answers in time, or is that just WISHFUL THINKING? Let\'s see how quickly you make the connections in this fun and challenging board game. You only have 60 seconds to figure out three Mystery words on the card. The only thing they have in common is that they all begin with the same letter. You (and your teammates) are allowed as many guesses as you like</p>\n<p>Product Dimensions:<br>13 x 8 x 1 inches<br>Model Number:<br>O4633<br>Date First Available:<br>August 20, 2019<br>ASIN:<br>B07WWZM89C<br>Occasion:<br>Daily, Lounge, Fall, Shopping<br>INCLUDES 3 FUN PRINTABLES! Along with our learning games for kids ages 3-5, you get access to 3 FULL-COLOR, PRINTABLE downloads to READ, STORY is a fun illustrated journey through sustainable plant harvesting, endangered plants, ecosystems and more. The 27-page WILDCRAFT! BOTANICAL COLORING BOOK helps kids learn the plants in our educational game. And our POCKET GUIDE is the perfect reference to take on family nature outings, hikes and camping trips! AT LearningHerbs, WE BELIEVE IN THE POWER OF CONNECTING KIDS TO NATURE and appreciating everything OUR GREAT EARTH HAS TO OFFER. As parents, we designed Wildcraft! fun family games for kids.</p>\n<p>Wildcraft An Herbal Adventure Game is a fun, that’s also easy to follow – NO READING required. Because our learning board games feature clear illustrations and matching icons, even younger kids will learn what the different plants look like and can be used for.</p></div></div></div>','any','2022-06-29 13:54:08','2022-06-29 13:54:08'),(3,'Download Monoclonal anti','.template-managerdownloadmonoclonalanti62e36b403cc29.jpg','<style>#html-body [data-pb-style=JEBPTPQ]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"JEBPTPQ\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><p><a tabindex=\"0\" href=\"https://swant.com/pdfs/Monoclonal_anti_calbindin_d28k_300.pdf\">Download PDF</a></p></div></div></div>','product','2022-07-29 05:08:16','2022-07-29 05:08:16'),(4,'Rabbit anti-Calbindin D-28k','.template-managerrabbitanticalbindind28k62e38fe399045.jpg','<style>#html-body [data-pb-style=U6FFI6S]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}#html-body [data-pb-style=BJ94TXR]{border-width:1px}#html-body [data-pb-style=OOCNTFW]{text-align:left}#html-body [data-pb-style=QG4D4T9]{border-width:1px;min-height:300px}#html-body [data-pb-style=E7FHJU3]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"U6FFI6S\"><div class=\"tab-align-left\" data-content-type=\"tabs\" data-appearance=\"default\" data-active-tab=\"\" data-element=\"main\"><ul role=\"tablist\" class=\"tabs-navigation\" data-element=\"navigation\" data-pb-style=\"OOCNTFW\"><li role=\"tab\" class=\"tab-header\" data-element=\"headers\" data-pb-style=\"BJ94TXR\"><a href=\"#WPX2D24\" class=\"tab-title\"><span class=\"tab-title\">Description</span></a></li></ul><div class=\"tabs-content\" data-element=\"content\" data-pb-style=\"QG4D4T9\"><div data-content-type=\"tab-item\" data-appearance=\"default\" data-tab-name=\"Description\" data-background-images=\"{}\" data-element=\"main\" id=\"WPX2D24\" data-pb-style=\"E7FHJU3\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><p>This antiserum was produced against recombinant rat calbindin D-28k (CB). It crossreacts<br>with calbindin D-28k from many other species, including human, monkey, rat, mouse chicken<br>and fish (Fig. 1). In immunoblots it recognizes a single band of approximately 27 -28 kDa. In<br>samples with very high (10-fold higher than CB) concentrations of the related protein<br>calretinin, a larger band (29 - 30 kDa) may appear in Western blots. Thus, depending on the<br>dilution of the antiserum and/or sensitivity of the immunostaining, this other calcium-binding<br>protein could be also revealed. In case of doubt, we suggest to switch to Swant’s monoclonal<br>antibody 300 directed against calbindin D-28k, which does not recognize calretinin.</p></div></div></div></div></div></div>','any','2022-07-29 07:44:35','2022-07-29 07:44:35'),(5,'Rabbit anti-Calbindin D-28k=2','.template-managerrabbitanticalbindind28k262e3906ae1fba.jpg','<style>#html-body [data-pb-style=BD6CW9U]{border-width:1px}#html-body [data-pb-style=TTCFWO0]{text-align:left}#html-body [data-pb-style=IFJJ3AN]{border-width:1px;min-height:300px}#html-body [data-pb-style=HJX2K0S]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div class=\"tab-align-left\" data-content-type=\"tabs\" data-appearance=\"default\" data-active-tab=\"\" data-element=\"main\"><ul role=\"tablist\" class=\"tabs-navigation\" data-element=\"navigation\" data-pb-style=\"TTCFWO0\"><li role=\"tab\" class=\"tab-header\" data-element=\"headers\" data-pb-style=\"BD6CW9U\"><a href=\"#SMA5UQ0\" class=\"tab-title\"><span class=\"tab-title\">Description</span></a></li></ul><div class=\"tabs-content\" data-element=\"content\" data-pb-style=\"IFJJ3AN\"><div data-content-type=\"tab-item\" data-appearance=\"default\" data-tab-name=\"Description\" data-background-images=\"{}\" data-element=\"main\" id=\"SMA5UQ0\" data-pb-style=\"HJX2K0S\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><p>This antiserum was produced against recombinant rat calbindin D-28k (CB). It crossreacts<br>with calbindin D-28k from many other species, including human, monkey, rat, mouse chicken<br>and fish (Fig. 1). In immunoblots it recognizes a single band of approximately 27 -28 kDa. In<br>samples with very high (10-fold higher than CB) concentrations of the related protein<br>calretinin, a larger band (29 - 30 kDa) may appear in Western blots. Thus, depending on the<br>dilution of the antiserum and/or sensitivity of the immunostaining, this other calcium-binding<br>protein could be also revealed. In case of doubt, we suggest to switch to Swant’s monoclonal<br>antibody 300 directed against calbindin D-28k, which does not recognize calretinin.</p></div></div></div></div>','any','2022-07-29 07:46:50','2022-07-29 07:46:50'),(6,'Mouse anti-calretinin (monoclonal)','.template-managermouseanticalretininmonoclonal62e3923facf52.jpg','<style>#html-body [data-pb-style=QE3S6Y3]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}#html-body [data-pb-style=C55BOYS]{border-width:1px}#html-body [data-pb-style=PISHU9D]{text-align:left}#html-body [data-pb-style=ML6PC4S]{border-width:1px;min-height:300px}#html-body [data-pb-style=IKXB54R]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"QE3S6Y3\"><div class=\"tab-align-left\" data-content-type=\"tabs\" data-appearance=\"default\" data-active-tab=\"\" data-element=\"main\"><ul role=\"tablist\" class=\"tabs-navigation\" data-element=\"navigation\" data-pb-style=\"PISHU9D\"><li role=\"tab\" class=\"tab-header\" data-element=\"headers\" data-pb-style=\"C55BOYS\"><a href=\"#E1OI8TH\" class=\"tab-title\"><span class=\"tab-title\">Description</span></a></li></ul><div class=\"tabs-content\" data-element=\"content\" data-pb-style=\"ML6PC4S\"><div data-content-type=\"tab-item\" data-appearance=\"default\" data-tab-name=\"Description\" data-background-images=\"{}\" data-element=\"main\" id=\"E1OI8TH\" data-pb-style=\"IKXB54R\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><p>The antibody against calretinin was produced in mice by immunization with recombinant<br>human calretinin-22k (1). Calretinin 22k is an alternative splice product of the calretinin gene<br>and identical with calretinin up to Arg178. After fusion, hybridoma cells were screened with<br>human recombinant calretinin as target and the clone 6B3 was selected. The antibody 6B3<br>recognizes an epitope within the first 4 EF-hands domains common to both calretinin and<br>calretinin-22k (1). It was evaluated for specificity and potency: a) by Biotin-Avidin labeling of<br>cryostate-, vibratome- and paraffin-sections of 4% paraformaldehyde (or 10% buffered<br>formalin) fixed brains b) by immunoenzymatic labelling of immunoblots c) by<br>immunohistochemistry on tissue of calretinin knock-out mice.<br>The product is a monoclonal antibody against calretinin a calcium-binding protein of the EFhand family related to calbindin D-28k and calmodulin (2). The antibody reacts specifically<br>with calretinin in tissue originating from human and rat. This antibody does not cross-react<br>with calbindin D-28k or other known calcium binding-proteins, as determined by its<br>distribution in the brain, as well as by immunoblots. The antibody recognizes calretinin in<br>human mesotheliomas (3,4).</p></div></div></div></div></div></div>','any','2022-07-29 07:54:39','2022-07-29 07:54:39'),(7,'Rabbit anti-calretinin','.template-managerrabbitanticalretinin62e392feef0da.jpg','<style>#html-body [data-pb-style=VL8TQOS]{border-width:1px}#html-body [data-pb-style=C6YTBTL]{text-align:left}#html-body [data-pb-style=ABNDBYV]{border-width:1px;min-height:300px}#html-body [data-pb-style=HV511VB]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div class=\"tab-align-left\" data-content-type=\"tabs\" data-appearance=\"default\" data-active-tab=\"\" data-element=\"main\"><ul role=\"tablist\" class=\"tabs-navigation\" data-element=\"navigation\" data-pb-style=\"C6YTBTL\"><li role=\"tab\" class=\"tab-header\" data-element=\"headers\" data-pb-style=\"VL8TQOS\"><a href=\"#KX54V99\" class=\"tab-title\"><span class=\"tab-title\">Description</span></a></li></ul><div class=\"tabs-content\" data-element=\"content\" data-pb-style=\"ABNDBYV\"><div data-content-type=\"tab-item\" data-appearance=\"default\" data-tab-name=\"Description\" data-background-images=\"{}\" data-element=\"main\" id=\"KX54V99\" data-pb-style=\"HV511VB\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><p id=\"INMNAQ5\" style=\"text-align: left;\">The antiserum against calretinin is produced in rabbits by immunization with recombinant<br>human calretinin containing a 6-his tag at the N-terminal. The antibody was evaluated for<br>specificity and potency: a) by Biotin-Avidin labeling of cryostate-, vibratome- and paraffinsections of 4% paraformaldehyde fixed brains and b) by immunoenzymatic labelling of<br>immunoblots.<br>The product is a polyclonal antiserum against calretinin (1), a calcium-binding protein of<br>the EF-hand family related to calbindin D-28k and calmodulin. The antibody reacts<br>specifically with calretinin in tissue originating from human, monkey, rat, mouse, guinea<br>pig, chicken and fish (Fig. 1). This antiserum does not cross-react with calbindin D-28k<br>or other known calcium binding-proteins, as determined by immunoblots and by its<br>distribution in the brain (Fig. 2).</p></div></div></div></div>','any','2022-07-29 07:57:51','2022-07-29 07:57:51');
